import React from 'react';
import {Container, Navbar} from "react-bootstrap";
import {GrElevator} from "react-icons/gr"

const Home = () => {
    return (
        <Navbar bg="light">
            <Container>
                <Navbar.Brand>
                    <GrElevator/>
                    <span style={{marginLeft: "10px"}}>Brand text</span>
                </Navbar.Brand>
            </Container>
        </Navbar>
    );
};

export default Home;
